import React from 'react';
import '../Styles/CircularProgressBar.css'

const CircularProgressBar = (props) => {
  const progressFillStyle = {
    transform: `rotate(${props.Proficiency / 100 * 360 + 90}deg)`,
    clipPath: `circle(${props.Proficiency}% at center)`
  };
  return (
    <div className="progress-bar">
      <div className="progress-bar-fill" style={progressFillStyle}></div>
      <div className="progress-bar-text">{`${props.Proficiency}%`}</div>
    </div>
  );
};

export default CircularProgressBar;
